import React from "react";

const GptSearchBar = () => {
  return (
    <div className="pt-[20%]">
      <form className="w-1/2 bg-black grid grid-cols-12">
        <input
          type="text"
          placeholder="Search for movies or TV shows..."
          className="p-4 m-4 rounded-md border border-gray-300 focus:outline-none focus:ring-2 focus:ring-red-600 col-span-8"
        />
        <button className="mt-2 p-2 bg-red-600 text-white rounded-md col-span-4">
          Search
        </button>
      </form>
    </div>
  );
};

export default GptSearchBar;
